import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import firebase from 'firebase'

var config = {
    apiKey: "AIzaSyAkp4h6EaMYaMbpWGx5FOYxK8Eomdzc55o",
    authDomain: "tentahelper.firebaseapp.com",
    databaseURL: "https://tentahelper.firebaseio.com",
    projectId: "tentahelper",
    storageBucket: "tentahelper.appspot.com",
    messagingSenderId: "740983647300"
};

firebase.initializeApp(config);

const auth = firebase.auth
const FBprovider = new auth.FacebookAuthProvider()

class App extends Component {


    render() {

          auth().onAuthStateChanged(function (user) {
            if (user) {
                // User is signed in.

            } else {
                // No user is signed in.
                auth().signInWithPopup(FBprovider)
                    .then(({user}) => {
                        this.setState({user})
                    })
            }
        });

        return (

            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo"/>
                    <p>
                        Edit <code>src/App.js</code> and save to reload.
                    </p>
                    <a
                        className="App-link"
                        href="https://reactjs.org"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                        Learn React
                    </a>
                </header>
            </div>
        );
    }
}

export default App;
